INSERT INTO blog."Blogs" ("Id", "Title", "Description", "Date", "Status", "AuthorId", "ClubId", "Votes", "VisibilityPolicy") VALUES (-11, 'Off-the-Beaten-Path Travel', '<p>Discover charming villages and secret natural havens off the tourist path. Immerse yourself in the heart of local cultures and explore hidden treasures. Pack your bags for an authentic travel experience!</p><p><br></p><p><img src="https://live.staticflickr.com/65535/53244354274_f096dbce42.jpg"></p><p><br></p><p>Join us on the road less traveled!</p>', '2023-11-14 00:00:00+01', 3, -170, NULL, '[{"UserId": -168, "VoteType": 1}, {"UserId": -170, "VoteType": 1}]', 0),
(-12, 'Historical Wonders: Time Travel Edition', '<p>Step into history with ancient ruins and medieval castles. Explore the mysteries of past civilizations and witness the grandeur of medieval architecture. Join us on a captivating journey through time!</p><p><br></p><p><img src="https://live.staticflickr.com/65535/53280758885_34afd10b3a.jpg"></p><p><br></p><p>Walk the corridors of history with us!</p>', '2023-11-14 00:00:00+01', 1, -169, NULL, '[{"UserId": -168, "VoteType": 0}, {"UserId": -170, "VoteType": 0}]', 0),
(-13, 'Urban Wanderlust: City Exploration', '<p>Delve into the heartbeat of vibrant cities! Explore bustling markets, iconic landmarks, and hidden gems within the urban landscape.</p><p>Immerse yourself in the culture and energy of city life.</p><p><br></p><p><img src="https://live.staticflickr.com/65535/53308142182_84983c1cc3.jpg"></p><p><br></p><p>Experience the pulse of the city with us!</p>', '2023-11-14 00:00:00+01', 0, -170, NULL, '[]', 0),
(-14, 'Team building grupa 1 (produžeci)', '<p>Nastavak kod Dragana na svirku i drinkić</p><p><br></p><p><img src="https://cdn.discordapp.com/attachments/1165638888082124852/1174054126708064327/IMG-20231113-WA0004.jpg"></p>', '2023-11-14 00:00:00+01', 1, -170, NULL, '[]', 0),
(-15, 'Team building grupa 1', '<p>Divno veče u ambijentu još divnijih ljudi huh</p><p><br></p><p><img src="https://cdn.discordapp.com/attachments/1165638888082124852/1174053744795734026/IMG-20231113-WA0006.jpg"></p>', '2023-11-14 00:00:00+01', 1, -170, NULL, '[]', 0),
(-16, 'Novi Sad u ritmu avanture: Prolazak kroz neistražene kutke', '<p>Uđite u svet Novog Sada kroz objektiv avanturističkog putnika. Ovaj blog istražuje neotkrivene kutke, donosi priče o lokalnom šarmu, kulturnim draguljima i autentičnim iskustvima. Pripremite se za vođenje kroz tajanstvene uličice, ukusnu hranu, i susrete sa lokalnim stanovništvom, dok zajedno otkrivamo bogatu baštinu Novog Sada. Pridružite se ovom putovanju u ritmu avanture i doživite grad na način koji se retko viđa.<img src="data:image/jpeg;base64,"></p>', '2024-01-16 01:00:00+01', 4, -2, NULL, '[{"UserId": -178, "VoteType": 1}, {"UserId": -170, "VoteType": 1}, {"UserId": -169, "VoteType": 1}]', 0),
(-17, 'Putovanje kroz kulturnu raskrsnicu', '<p>Upustite se u nezaboravno ''Putovanje Kroz Kulturnu Raskrsnicu'' i doživite spoj raznolikosti, istorije i umetnosti u ovom jedinstvenom putničkom iskustvu. Ovaj blog će vas voditi kroz neistražene kulturne kutke gradova, donoseći vam priče o tradiciji, savremenoj umetnosti, gastronomiji i lokalnom duhu. Saznajte kako se različite kulture prepliću na ovoj raskrsnici, istražujući fascinantne destinacije i deleći autentične doživljaje</p><p><img src="data:image/jpeg;base64,"></p>', '2024-01-16 01:00:00+01', 4, -2, NULL, '[{"UserId": -180, "VoteType": 1}, {"UserId": -177, "VoteType": 1}, {"UserId": -176, "VoteType": 1}]', 0),
(-18, 'Temišvar', '<p>Poštovani studenti, zovemo vas da zajedno sa nama putujete u Temišvar.</p>', '2023-12-14 00:00:00+01', 1, -3, -104, '[{"UserId": -168, "VoteType": 1}, {"UserId": -170, "VoteType": 1}]', 0),
(-19, 'Budimpešta', '<p>Da li preporučujete put u Budimpeštu?</p>', '2023-12-14 00:00:00+01', 1, -3, -104, '[{"UserId": -168, "VoteType": 1}, {"UserId": -170, "VoteType": 1}]', 0),
(-20, 'Istanbul', '<p>Kakva je hrana u Istanbulu?</p>', '2023-12-14 00:00:00+01', 1, -3, -104, '[{"UserId": -168, "VoteType": 1}, {"UserId": -170, "VoteType": 1}]', 0);
